import { Component, OnInit, Input, EventEmitter, Output, ChangeDetectorRef } from '@angular/core';
import { FormControl } from '@angular/forms';
import { AdvancedSearchModel } from '../utilities/models/advanced-search-model';
import { FunctionsService } from '../utilities/services/functions.service';
import { MatDialog } from '@angular/material/dialog';
import { PopupComponent } from '@app/components/popup/popup.component';
import { DatePipe } from '@angular/common';
import { MatAutocompleteSelectedEvent } from '@angular/material/autocomplete';
import { GlobalFunctionService } from '@app/shared/services/global-function.service';

@Component({
	selector: 'app-advanced-search',
	templateUrl: './advanced-search.component.html',
	styleUrls: ['./advanced-search.component.scss']
})
export class AdvancedSearchComponent implements OnInit {

	/**
	 * @desc Angular Input Decorator - Common Parameters
	 * @param object field - file upload field data.
	 * @param formControl control - file upload control.
	 */
	@Input() field: AdvancedSearchModel;
	@Input() control: FormControl;

	/**
	 * @desc Angular Output Decorator - Common Parameters
	 * @param object helpLineEmit - help line json data.
	 */
	@Output() helpLineEmit = new EventEmitter();
	@Output() selectedCategory = new EventEmitter<string>();
	@Output() filterData = new EventEmitter();
	@Output() search = new EventEmitter<boolean>();
	@Output() clear = new EventEmitter<boolean>();

	filterValue = [];
	controlValue = null;
	isSearched = false;

	constructor(
		public controlFunctions: FunctionsService,
		public popup: MatDialog,
		private cdref: ChangeDetectorRef,
		public gfService: GlobalFunctionService
	) { }

	ngOnInit(): void {
		this.controlValue = this.control.value;
		if (this.controlValue) {
			this.isSearched = true;
		}
		if (this.field.additionalMetaData.hasOwnProperty('textBased')) {
			if (this.field.additionalMetaData.textBased) {
				this.control.valueChanges.subscribe((controlResp) => {
					if (!controlResp) {
						this.filterValue = [];
						this.filterData.emit([]);
						this.field.additionalMetaData.filter.forEach((field) => {
							field.value = null;
							if (field.fieldType === 'autoComplete') {
								field.selectedValue = [];
							}
						});
					}
				});
			}
		}
	}


	/**
	 * @desc Display the auto complete value
	 * @param object data - auto complete data.
	 */
	displayAC(data) {
		if (data && typeof data === 'object') {
			return data.value;
		} else {
			return data;
		}
	}

	categorySelect(data, filterColumn: string) {
		if (navigator.onLine) {
			this.field.category.value = data;
			const field = this.field.additionalMetaData.filter.find(items => items.fieldColumn === filterColumn);
			if (field) {
				const findData = this.filterValue.find(items => items.fieldColumn === filterColumn);
				if (findData) {
					findData.value = data.value;
					findData.actualValue = data.key;
				} else {
					this.filterValue.push(
						{
							fieldCaption: field.fieldCaption,
							fieldColumn: field.fieldColumn,
							value: data.value,
							actualValue: data.key,
							hide: true
						}
					);
				}
				field.value = data.key;
				this.filterData.emit(this.filterValue);
			} else {
				this.selectedCategory.next(data);
			}
		}
	}

	clearCategory() {
		if (navigator.onLine) {
			this.field.category.value = null;
			const field = this.field.additionalMetaData.filter.find(items => items.fieldColumn === this.field.category.filterColumn);
			if (field) {
				field.value = null;
				this.filterValue = this.filterValue.filter(items => items.fieldColumn !== field.fieldColumn);
				this.filterData.emit(this.filterValue);
			} else {
				this.filterValue = [];
				this.filterData.emit(this.filterValue);
				this.selectedCategory.next(null);
			}
		}
	}

	filter(actionEl) {
		if (navigator.onLine) {
			const keywords = this.field.additionalMetaData.filter.find(items => items.fieldColumn === 'keywords');
			if (keywords && !([null, undefined].includes(this.control.value))) {
				keywords.value = (typeof this.control.value === 'object') ? this.control.value.value : this.control.value;
			}
			const owlDate = this.field.additionalMetaData.filter.find(items => items.fieldType === 'owlDate');
			if (owlDate) {
				console.log(owlDate);
			}
			const dialogRef = this.popup.open(PopupComponent, {
				panelClass: ['custom-panel'],
				maxWidth: '860px',
				data: {
					fieldList: this.field.additionalMetaData.filter,
					action: 'filter',
					triggerEl: actionEl
				},
				disableClose: true,
				autoFocus: false
			});
			dialogRef.afterClosed().subscribe(async (result) => {
				if (result) {
					const fields = result.fields;
					let owlDateValue = [];
					for (const field of this.field.additionalMetaData.filter) {
						if (this.field.category && this.field.category.filterColumn === field.fieldColumn) {
							const selectedData = this.field.category.data.find(items => items.key === result.formValue[field.fieldColumn]);
							this.field.category.value = selectedData;
						}
						if (field.fieldColumn === 'keywords') {
							this.control.patchValue(result.formValue[field.fieldColumn], { emitEvent: false });
							this.controlValue = result.formValue[field.fieldColumn];
							this.isSearched = true;
						}
						field.value = result.formValue[field.fieldColumn];
						let actualValue = result.formValue[field.fieldColumn];
						let value = result.formValue[field.fieldColumn];
						if (result.formValue[field.fieldColumn]) {
							if (field.fieldType === 'dropDown') {
								value = field.options.find(items => items.key === value).value;
							} else if (field.fieldType === 'owlDate') {
								if (value && value.length > 1) {
									owlDateValue = [...value];
									value[0] = new DatePipe('en-US').transform(value[0], 'MMM d, y');
									value[1] = new DatePipe('en-US').transform(value[1], 'MMM d, y');
									value = value.join(' - ');
								}
							} else if (field.fieldType === 'autoComplete') {
								if (field.selectedValue.length) {
									const selectedValue = [];
									actualValue = [];
									for (const data of field.selectedValue) {
										if (data.isAdd && !data.isDelete) {
											selectedValue.push(data.value);
											actualValue.push(data.key);
										}
									}
									value = selectedValue.toString().replace(/(?:,)/g, ', ');
								}
							}
						}
						const filter = this.filterValue.find(items => items.fieldColumn === field.fieldColumn);
						if (filter) {
							filter.value = value;
							filter.actualValue = actualValue;
						} else {
							const pushJson: any = {
								fieldCaption: field.fieldCaption,
								fieldColumn: field.fieldColumn,
								value,
								actualValue,
								fieldType: field.fieldType
							};
							if ((this.field.category && field.fieldColumn === this.field.category.filterColumn) || field.fieldColumn === 'keywords') {
								pushJson.hide = true;
							}
							this.filterValue.push(pushJson);
						}
						if (field.fieldType === 'owlDate' && field.value) {
							if (field.value.length > 0) {
								field.value = owlDateValue;
							} else {
								field.value = null;
							}
						}
					}
					this.filterData.emit(this.filterValue);
				}
			});
		}
	}

	removeFilter(data) {
		if (navigator.onLine) {
			const field = this.field.additionalMetaData.filter.find(items => items.fieldColumn === data.fieldColumn);
			if (field) {
				field.value = null;
				if (field.fieldType === 'autoComplete') {
					field.selectedValue = [];
				}
			}
			this.filterValue = this.filterValue.filter(items => items.fieldColumn !== data.fieldColumn);
			this.filterData.emit(this.filterValue);
		}
	}

	searching() {
		if (navigator.onLine) {
			if (this.controlValue || this.control.value) {
				this.isSearched = true;
				this.search.emit(true);
			} else if (this.filterValue.find(items => !items.hide && items.value) || (this.field.category && this.field.category.value)) {
				this.isSearched = true;
				this.search.emit(true);
			}
			if (!this.control.value) {
				this.filterValue = [];
				this.filterData.emit(this.filterValue);
			}
			this.controlValue = this.control.value;
		}
	}

	clearSearch() {
		if (navigator.onLine) {
			const keywords = this.field.additionalMetaData.filter.find(items => items.fieldColumn === 'keywords');
			if (keywords) {
				keywords.value = null;
			}
			this.control.patchValue(null);
			this.controlValue = null;
			// this.filterValue = [];
			// this.filterData.emit(this.filterValue);
			if (this.isSearched) {
				this.clear.emit(true);
			}
		}
	}

	selected(event: MatAutocompleteSelectedEvent): void {
		// this.field.selectedValue = [];
		// this.field.selectedValue.push(event.option.value);
		// this.control.patchValue(event.option.value);
	}

	/**
	 * @desc Help line field change method and emit the data.
	 * @param {json} data help line json data.
	 */
	helpLineData(data) {
		this.helpLineEmit.emit(data);
	}

}
<div class="search-block" [ngClass]="field?.type" fxLayout="column" fxLayoutAlign="start stretch" fxLayoutGap="20px">
  <mat-label *ngIf="![null, undefined, ''].includes(field?.fieldCaption) && field?.additionalMetaData?.showLabel">
    {{field?.fieldCaption}}
  </mat-label>
  <div fxLayout="row" fxLayoutAlign="center">
    <div class="search-info" fxFlex="0 1 600px" fxFlex.xs="100%" fxLayout="row" fxLayoutAlign="start stretch">
      <ng-container *ngIf="!field?.category?.value && field?.category?.data?.length">
        <button matPrefix mat-icon-button [matMenuTriggerFor]="menu" aria-label="Example icon-button with a menu">
          <mat-icon class="drop-icon">arrow_drop_down</mat-icon>
        </button>
        <mat-menu #menu>
          <ng-container *ngFor="let category of field?.category?.data">
            <button type="button" mat-menu-item (click)="categorySelect(category, field?.category?.filterColumn)"
              [value]="field?.category?.value">
              <span>{{category.value}}</span>
            </button>
          </ng-container>
        </mat-menu>
      </ng-container>
      <ng-container *ngIf="field?.category?.value">
        <div class="text-info" fxLayout="row" fxLayoutAlign="start center" fxLayoutGap="15px">
          <p>{{field?.category?.value.value}}</p>
          <button mat-icon-button class="clear-icon" (click)="clearCategory()">
            <mat-icon>close</mat-icon>
          </button>
        </div>
      </ng-container>
      <!-- <mat-form-field> -->
      <input [ngStyle]="{'padding-left': (!field?.category?.data?.length) ? '15px' : '0' }" type="text" matInput
        [matAutocomplete]="auto" [formControl]="control" [placeholder]="field.fieldPlaceholder"
        (keyup.enter)="searching()">
      <mat-autocomplete #auto="matAutocomplete" [displayWith]="displayAC" (optionSelected)="selected($event)">
        <ng-container *ngFor="let data of field?.options">
          <mat-option *ngIf="!data.groupName" [matTooltip]="data.value" [disabled]="data.disabled" [value]="data">
            <ng-container [ngTemplateOutlet]="optionTemplate" [ngTemplateOutletContext]="{data:data}"></ng-container>
          </mat-option>
          <ng-container *ngIf="![null, undefined].includes(data.groupName) && data?.options?.length">
            <!-- <mat-optgroup [label]="data.groupName" [disabled]="data.disabled"> -->
            <div>
              {{data.groupName}}
            </div>
            <mat-option *ngFor="let data of data.options" [value]="data" [matTooltip]="data.value">
              <ng-container [ngTemplateOutlet]="optionTemplate" [ngTemplateOutletContext]="{data:data}">
              </ng-container>
            </mat-option>
            <!-- </mat-optgroup> -->
          </ng-container>
          <ng-template #optionTemplate let-data='data'>
            <div class="dropdown-item" fxLayout="row" fxLayoutAlign="start center" fxLayoutGap="10px">
              <div fxFlex="1 0" fxLayout="row" fxLayoutAlign="start center" fxLayoutGap="10px">
                <ng-container *ngIf="data?.prefix">
                  <ng-container *ngIf="data?.prefix?.type === 'image'">
                    <div class="thumbnail" [matTooltip]="data?.prefix?.tooltip">
                      <img [src]="data?.prefix?.value" (error)="gfService.setErrorImage($event, 'broken_image')" alt="">
                    </div>
                  </ng-container>
                  <ng-container *ngIf="data?.prefix?.type === 'icon'">
                    <mat-icon>{{data?.prefix?.value}}</mat-icon>
                  </ng-container>
                </ng-container>
                <div class="short-txt">
                  <p>{{data.value}}</p>
                  <ng-container *ngIf="data?.shortInfo?.length">
                    <div fxLayout="row" fxLayoutGap="3px" class="short-info">
                      <ng-container *ngFor="let info of data?.shortInfo; let index = index">
                        <span>{{info?.value}}</span>
                        <ng-container *ngIf="index !== (data?.shortInfo?.length - 1)">
                          <span>|</span>
                        </ng-container>
                      </ng-container>
                    </div>
                  </ng-container>
                </div>
              </div>
              <ng-container *ngIf="data?.suffix">
                <ng-container *ngIf="data?.suffix?.type === 'icon'">
                  <mat-icon class="custom-icon">{{data?.suffix?.value}}</mat-icon>
                </ng-container>
              </ng-container>
            </div>
          </ng-template>
        </ng-container>
      </mat-autocomplete>
      <!-- </mat-form-field> -->
      <div fxLayout="row" fxLayoutAlign="start center" fxLayoutGap="5px" class="suff-icons">
        <ng-container *ngIf="control?.value">
          <button mat-icon-button matSuffix class="clear-icon" (click)="clearSearch()">
            <mat-icon>clear</mat-icon>
          </button>
        </ng-container>
        <ng-container
          *ngIf="field.additionalMetaData.filter?.length && (!field?.additionalMetaData?.textBased || control?.value)">
          <button mat-icon-button matSuffix class="search-icons" #filterAction (click)="filter(filterAction)">
            <mat-icon>filter_list</mat-icon>
          </button>
        </ng-container>
        <mat-icon matSuffix class="search-icons common cursor-pointer" (click)="searching()">search</mat-icon>
      </div>
    </div>
  </div>

  <mat-hint *ngIf="(control.untouched || control.valid) && ![null, undefined, ''].includes(field.fieldHelpText)">
    {{field.fieldHelpText}}</mat-hint>

  <ng-container *ngIf="field?.helpLine?.length">
    <app-help-line [helpLineData]="field.helpLine" fxLayout="row" fxLayoutAlign="start start"
      (helpLineEmit)="helpLineData($event)"></app-help-line>
  </ng-container>
  <!----ending-->
  <ng-container *ngIf="filterValue?.length">
    <div class="badge-info" fxLayout="row wrap" fxLayoutAlign="start stretch" fxLayoutGap="10px">
      <ng-container *ngFor="let data of filterValue">
        <ng-container *ngIf="!data?.hide && data?.value">
          <!-- <div class="capsule" fxLayout="row" fxLayoutAlign="center stretch">
						<div class="title-info" fxLayoutAlign="center center">
							<p class="title">{{data?.fieldCaption}}</p>
						</div>
						<div class="value-info" fxLayoutAlign="center center" fxLayoutGap="5px">
							<p class="value">{{data?.value}}</p>
							<button mat-icon-button class="remove-icon">
								<mat-icon class="cursor-pointer" (click)="removeFilter(data)">cancel</mat-icon>
							</button>
						</div>
					</div> -->
          <!-- <app-chips [data]="{title: data?.fieldCaption, value: data?.value}" [removable]="true"
						(removed)="removeFilter(data)" type="capsule">
					</app-chips> -->
          <app-chips fxFlex="0 0 auto" fxFlex.xs="1 1" class="active-grand-chip" type="royal-capsule" [removable]="true"
            (removed)="removeFilter(data)" [changeFilter]="false"
            [data]="{title: data?.fieldCaption, value: data?.value}">
          </app-chips>
        </ng-container>
        <!-- <div class="capsule"> -->
        <!-- </div> -->
      </ng-container>
    </div>
  </ng-container>
</div>
